import React from "react";

const Header = () => {
  return (
    <nav className="navbar navbar-light bg-ligth">
      <a className="navbar-brand" href="#">
        <img
          src={process.env.PUBLIC_URL + "/logo_obs.jpg"}
          width="250"
          height="80"
          alt="logo_obs"
          loading="lazy"
        />
        <img
          src={process.env.PUBLIC_URL + "/logo_ide.png"}
          width="80"
          height="80"
          alt="logo_ide"
          loading="lazy"
        />
      </a>
    </nav>
  );
};

export default Header;
